name: GFXMMU
description: GFXMMU
groupName: GFXMMU
baseAddress: 1073922048
registers:
- name: GFXMMU_CR
  displayName: GFXMMU_CR
  description: GFXMMU configuration register
  addressOffset: 0
  size: 32
  resetValue: 0
  resetMask: 4294967295
  fields:
  - name: B0OIE
    description: "Buffer 0 overflow interrupt enable\nThis bit enables the buffer\
      \ 0 overflow interrupt."
    bitOffset: 0
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Interrupt disable
      value: 0
    - name: B_0x1
      description: Interrupt enabled
      value: 1
  - name: B1OIE
    description: "Buffer 1 overflow interrupt enable\nThis bit enables the buffer\
      \ 1 overflow interrupt."
    bitOffset: 1
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Interrupt disable
      value: 0
    - name: B_0x1
      description: Interrupt enabled
      value: 1
  - name: B2OIE
    description: "Buffer 2 overflow interrupt enable\nThis bit enables the buffer\
      \ 2 overflow interrupt."
    bitOffset: 2
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Interrupt disable
      value: 0
    - name: B_0x1
      description: Interrupt enabled
      value: 1
  - name: B3OIE
    description: "Buffer 3 overflow interrupt enable\nThis bit enables the buffer\
      \ 3 overflow interrupt."
    bitOffset: 3
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Interrupt disable
      value: 0
    - name: B_0x1
      description: Interrupt enabled
      value: 1
  - name: AMEIE
    description: "AHB master error interrupt enable\nThis bit enables the AHB master\
      \ error interrupt."
    bitOffset: 4
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Interrupt disable
      value: 0
    - name: B_0x1
      description: Interrupt enabled
      value: 1
  - name: BM192
    description: "192 Block mode\nThis bit defines the number of blocks per line"
    bitOffset: 6
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: 256 blocks per line
      value: 0
    - name: B_0x1
      description: 192 blocks per line
      value: 1
  - name: CE
    description: "Cache enable\nThis bit enables the cache unit."
    bitOffset: 7
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Cache disable
      value: 0
    - name: B_0x1
      description: Cache enable
      value: 1
  - name: CL
    description: "Cache lock\nThis bit lock the cache onto the buffer defined in the\
      \ CLB field."
    bitOffset: 8
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Cache not locked
      value: 0
    - name: B_0x1
      description: Cache locked to a buffer
      value: 1
  - name: CLB
    description: "Cache lock buffer\nThis field select the buffer on which the cache\
      \ is locked."
    bitOffset: 9
    bitWidth: 2
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Cache locked on buffer 0
      value: 0
    - name: B_0x1
      description: Cache locked on buffer 1
      value: 1
    - name: B_0x2
      description: Cache locked on buffer 2
      value: 2
    - name: B_0x3
      description: Cache locked on buffer 3
      value: 3
  - name: FC
    description: "Force caching\nThis bit force the caching into the cache regardless\
      \ of the MPU attributes.\nThe cache must be enable (CE bit set)."
    bitOffset: 11
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Caching not forced
      value: 0
    - name: B_0x1
      description: Caching forced
      value: 1
  - name: PD
    description: "Prefetch disable\nThis bit disables the prefetch of the cache."
    bitOffset: 12
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Prefetch enable
      value: 0
    - name: B_0x1
      description: Prefetch disable
      value: 1
  - name: OC
    description: "Outter cachability\nThis bit configure the cachability of an access\
      \ generated by the GFXMMU cache."
    bitOffset: 16
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: No cachable
      value: 0
    - name: B_0x1
      description: Cachable
      value: 1
  - name: OB
    description: "Outter bufferability\nThis bit configure the bufferability of an\
      \ access generated by the GFXMMU cache."
    bitOffset: 17
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: No bufferable
      value: 0
    - name: B_0x1
      description: Bufferable
      value: 1
- name: GFXMMU_SR
  displayName: GFXMMU_SR
  description: GFXMMU status register
  addressOffset: 4
  size: 32
  resetValue: 0
  resetMask: 4294967295
  fields:
  - name: B0OF
    description: "Buffer 0 overflow flag\nThis bit is set when an overflow occurs\
      \ during the offset calculation of the buffer 0. It is cleared by writing 1\
      \ to CB0OF."
    bitOffset: 0
    bitWidth: 1
    access: read-only
  - name: B1OF
    description: "Buffer 1 overflow flag\nThis bit is set when an overflow occurs\
      \ during the offset calculation of the buffer 1. It is cleared by writing 1\
      \ to CB1OF."
    bitOffset: 1
    bitWidth: 1
    access: read-only
  - name: B2OF
    description: "Buffer 2 overflow flag\nThis bit is set when an overflow occurs\
      \ during the offset calculation of the buffer 2. It is cleared by writing 1\
      \ to CB2OF."
    bitOffset: 2
    bitWidth: 1
    access: read-only
  - name: B3OF
    description: "Buffer 3 overflow flag\nThis bit is set when an overflow occurs\
      \ during the offset calculation of the buffer 3. It is cleared by writing 1\
      \ to CB3OF."
    bitOffset: 3
    bitWidth: 1
    access: read-only
  - name: AMEF
    description: "AHB master error flag\nThis bit is set when an AHB error happens\
      \ during a transaction. It is cleared by writing 1 to CAMEF."
    bitOffset: 4
    bitWidth: 1
    access: read-only
- name: GFXMMU_FCR
  displayName: GFXMMU_FCR
  description: GFXMMU flag clear register
  addressOffset: 8
  size: 32
  resetValue: 0
  resetMask: 4294967295
  fields:
  - name: CB0OF
    description: "Clear buffer 0 overflow flag\nWriting 1 clears the buffer 0 overflow\
      \ flag in the GFXMMU_SR register."
    bitOffset: 0
    bitWidth: 1
    access: read-write
  - name: CB1OF
    description: "Clear buffer 1 overflow flag\nWriting 1 clears the buffer 1 overflow\
      \ flag in the GFXMMU_SR register."
    bitOffset: 1
    bitWidth: 1
    access: read-write
  - name: CB2OF
    description: "Clear buffer 2 overflow flag\nWriting 1 clears the buffer 2 overflow\
      \ flag in the GFXMMU_SR register."
    bitOffset: 2
    bitWidth: 1
    access: read-write
  - name: CB3OF
    description: "Clear buffer 3 overflow flag\nWriting 1 clears the buffer 3 overflow\
      \ flag in the GFXMMU_SR register."
    bitOffset: 3
    bitWidth: 1
    access: read-write
  - name: CAMEF
    description: "Clear AHB master error flag\nWriting 1 clears the AHB master error\
      \ flag in the GFXMMU_SR register."
    bitOffset: 4
    bitWidth: 1
    access: read-write
- name: GFXMMU_CCR
  displayName: GFXMMU_CCR
  description: GFXMMU cache control register
  addressOffset: 12
  size: 32
  resetValue: 0
  resetMask: 4294967295
  fields:
  - name: FF
    description: "Force flush\nWhen set, the cache entries are flushed. This bit is\
      \ reset by hardware when the flushing is complete. Write 0 has no effect."
    bitOffset: 0
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Flushing process complete
      value: 0
    - name: B_0x1
      description: Force flush/flushing process on going
      value: 1
  - name: FI
    description: "Force invalidate\nWhen set, the cache entries are invalidated. This\
      \ bit is reset by hardware when the invalidation is complete. Write 0 has no\
      \ effect."
    bitOffset: 1
    bitWidth: 1
    access: read-write
    enumeratedValues:
    - name: B_0x0
      description: Invalidation process complete
      value: 0
    - name: B_0x1
      description: Force invalidation/invalidation process on going
      value: 1
